import React from 'react';
import logo from './logo.svg';
import './App.css';
import { HttpResponse, useApiClient } from './Services/api/apiClient';
import { useEffect, useState } from 'react';
import { TodoModel } from './types/apiClient';


 function App() {

     let todos = useApiClient();
     const [data, setData] = useState<TodoModel[]>([]);

     const getTodos = async () => {
         let response: HttpResponse<TodoModel[]>;

         response = await todos.getTodos();
         setData(response);
        
        
     };
 
     useEffect(() => {
         getTodos();
     }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Todo List A
        </p>
              {data.body.map((value: any, index: number) =>
              (<div>value.id</div>))}
          </header>
    </div>
  );
}

export default App;
